/* eslint-disable */
const uuSubAppInstanceDescriptor = shape({
  schemaVersion: string(/\bv?(?:0|[1-9]\d*)\.(?:0|[1-9]\d*)\.(?:0|[1-9]\d*)(?:-[\da-z-]+(?:\.[\da-z-]+)*)?(?:\+[\da-z-]+(?:\.[\da-z-]+)*)?\b/i).isRequired(),
  schemaSpecificationUri: uri(),
  uuSubApp: shape({
    code: string(/^[0-9a-zA-Z_.\/]{3,64}$/).isRequired(),
    version: string(/\bv?(?:0|[1-9]\d*)\.(?:0|[1-9]\d*)\.(?:0|[1-9]\d*)(?:-[\da-z-]+(?:\.[\da-z-]+)*)?(?:\+[\da-z-]+(?:\.[\da-z-]+)*)?\b/i).isRequired(),
    name: string(1000),
    description: string(5000),
    license: string(1000),
    route: uri(),
    asidRequired: boolean(),
    awidCount: integer(1, 1000),
    uuEeMap: map(string(), uuIdentity()),
    resourcePoolUri: uri(),
    targetSlot: oneOf(["PRODUCTION", "BETA"]),
    appBoxUri: uri(),
    progressProvider: oneOf(["uuLogStore", "uu8Artifact"]),
    uuAppCdnMap: map(
      string(/^[0-9a-zA-Z_.\/]{3,64}$/), shape({
        appPackUri: uri().isRequired(),
        sppRoute: string()
      })
    ),
    uuAppNodeSetMap: map(
      string(/^[0-9a-zA-Z_.\/]{3,64}$/), shape({
        nodeSize: oneOf(["G1_S", "G1_M", "G1_L", "G1_XL", "C1_S", "C1_M", "C1_L", "C1_XL"]).isRequired(),
        nodeCount: shape({
          min: integer(1, 1000).isRequired(),
          max: integer(1, 1000).isRequired()
        }).isRequired(),
        sppRoute: string(),
        appPackUri: uri().isRequired(),
        runtimeStack: string(/^[0-9a-zA-Z_.\/-]{3,64}$/).isRequired()
      }).isRequired()
    ),
    uuAppObjectStoreMap: map(
      string(/^[0-9a-zA-Z_.\/]{3,64}$/), shape({
        technology: oneOf(["MongoDB-3.4", "MongoDB-4.0"]),
        size: oneOf([0.25, 0.5, 1, 5, 10, 50, 100]).isRequired(),
        backup: boolean(),
        alias: string(/^[0-9a-zA-Z_.\/]{3,64}$/).isRequired()
      }).isRequired()
    ),
    uuAppBinaryStoreMap: map(
      string(/^[0-9a-zA-Z_.\/]{3,64}$/), shape({
        technology: oneOf(["MongoDB-3.4", "MongoDB-4.0"]),
        size: oneOf([0.25, 0.5, 1, 5, 10, 50, 100]).isRequired(),
        backup: boolean(),
        alias: string(/^[0-9a-zA-Z_.\/]{3,64}$/).isRequired()
      }).isRequired()
    ),
    uuSaasMap: map(
      string(/^[0-9a-zA-Z_.\/]{3,64}$/), shape({
        type: oneOf(["uuFulltextSearch", "uuAppMessageBroker"]).isRequired(),
        license: oneOf(["S", "M", "L"]).isRequired(),
        parametersMap: map(string(), any())
      })
    ),
    uuConfigMap: map(string(100), any())
  }).isRequired()
});
